import React, { Component } from "react";
import Tabs, { TabPane } from 'rc-tabs';
import ProjectCard from './ProjectCard';
import { PROJECTS } from '../contents/Projectsdata';
import '../../node_modules/rc-tabs/assets/index.css';

class AllTabs extends Component {

    constructor(props) {
        super(props);
        this.state = {
            projects: PROJECTS
        }
    }
    render() {
        return (
            <div className="tablist">
                <Tabs defaultActiveKey="1" tabBarGutter={100}>
                    <TabPane tab="All" key="1">
                        <ProjectCard image={this.state.projects[0].image} name={this.state.projects[0].name} description={this.state.projects[0].description}/>
                        <ProjectCard image={this.state.projects[0].image} name={this.state.projects[0].name} description={this.state.projects[0].description}/>
                        <ProjectCard image={this.state.projects[0].image} name={this.state.projects[0].name} description={this.state.projects[0].description}/>
                </TabPane>
                    <TabPane tab="Bootstrap" key="2">
                        Render Bootstrap Projects Here
                </TabPane>
                    <TabPane tab="React" key="3">
                        Render React Projects Here
                </TabPane>
                </Tabs>
            </div>
        );
    }
}

export default AllTabs;
